load("moveData/MPmoveData.mat")
function T=setC(T)
    for ii=1:height(T)
        T.C(ii)=keyHash([T.gc(ii,:),{T.ori(ii,:)}]);
    end
end
function dispArr(arr)
    disp(join(reshape(reshape(arr,4,4)',16,1)))
end
[TL1,TL2,TL3]=deal(T_MP_L(:,["param","gc","ori"]));
TL2.param2=["A3","B3","D1","C1","A4","B4","D2","C2","A1","B1","D3","C3","A2","B2","D4","C4"]';
TL3.param2=["B1","A1","D4","C4","B2","A2","D2","C2","B3","A3","D3","C3","B4","A4","D1","C1"]';
TL2.ori=-TL2.ori;
TL3.ori=-TL3.ori;
TL2.gc=cellfun(@fliplr,TL2.gc,UniformOutput=false);
TL3.gc=cellfun(@(x)-x,TL3.gc,UniformOutput=false);
TL1=setC(TL1);
TL2=setC(TL2);
TL3=setC(TL3);
%%

disp(TL1) %[output:1fefd77b]
disp(TL3) %[output:92100769]
%%
[~,arr]=ismember(TL1.C,TL2.C);
[~,arr2]=ismember(TL1.C,TL3.C);
TL3.param3(:)="NaN";
TL3.param3(arr2>0)=TL1.param(arr2(arr2>0));
dispArr(TL1.param) %[output:67a75ad1]

dispArr(TL1.param(arr)) %[output:89627690]
disp(TL1) %[output:1d783228]
disp(TL3) %[output:4272707a]
